<!DOCTYPE html>
<html>

<head>
	<meta charset="utf-8">
	<title>Mac Key Symbols</title>
	<style>
		html,
		body,
		img {
			padding: 0;
			margin: 0;
			position: absolute;
			top: 0;
			left: 0;
			height: 100%;
			width: 100%;
			cursor: move;
		}
		*{
			-webkit-touch-callout: none;
			-webkit-user-select: none;
			-khtml-user-select: none;
			-moz-user-select: none;
			-ms-user-select: none;
			user-select: none;
		}
		a {
			    position: absolute;
			    top: 0;
			    right: 0;
			    cursor: pointer;
			    padding: 7px 11px;
			    background: #444;
			    font-weight: bold;
			    color: #eee;
			    font-family: arial;
			    border-radius: 0 0 0 7px;
		}
		a:active{

			    background: #222;
				color: #fff;
		}
		a > span{
			transform: matrix(1.3,0,0,1,0,0);
			display: block;
			text-shadow: 1px 1px #000;
		}
		.dragger{
			-webkit-app-region: drag;
			position: absolute;
			left: 0;
			bottom: 0;
			background: blue;
			opacity: 0;
		}
		#dragger1{
			height: 100%;
			width: calc(100% - 32px);
		}
		#dragger2{
			width: 100%;
			height: calc(100% - 32px);
		}
	</style>
</head>
